export default async function enviarLinks(req, res) {
    if (req.method !== "POST") {
        return res.status(405).json({ error: `Método não permitido: ${req.method}` });
    }
    const { loja } = req.body;
    if (!loja || !links[loja]) {
        return res.status(400).json({ error: "Loja inválida ou não encontrada." });
    }
    
    return res.status(200).json({ ...links[loja] });
}